Sometimes it is better to let the models do their thing. Emma is that kind of character you cannot control in front of the camera. She is doing her own show. After working with her for several days I realized that EMMA stands for Emma Means More Adrenalin. I am sure she would say Eoweo Meow Meow Aowow or something like that.
